description:
The first ever DVD from the UK's best loved football show. Revel in 20 years of cheers, jeers and tears from the legendary Soccer Saturday with all of the show's funniest football banter PLUS footage produced exclusively for this DVD. All of the golden moments have been painstakingly brought together and come with a special introduction by the legend himself - Jeff Stelling. Join in all the fun with Jeff, Kammy and the rest of the team. The ultimate gift for any self-respecting football fan.
DVD rip comes with the bonus &quot;Senior Stars&quot;
